		obj = new JSONObject("{\"id\":\"2297\",\"Sitepmr\":\"site accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Auvergne\",\"Siteville\":\"Saint-Martin-Cantalès\",\"Sitenom\":\"Saint-Martin-Cantalès\",\"proprietaire\":\"Commune de Saint-Martin-Cantales\",\"mot_cle\":\"commémoration, géologie, monument aux morts, soldats, guerre, mémoire\",\"longueur\":\"3\",\"hauteur\":\"4\",\"precision_materiaux\":\"La base/socle du monument est constituée en pierre de lave (Auvergne). Au-dessus, de grands blocs-sculptures sont extraits de « lieux blessés » : la bataille de la Marne, incarnée par la pierre de Langres ; la bataille des Flandres, par le marbre bleu du Hainaut ; et aussi des pierres en provenance du Maroc (rouge), d’ex-Yougoslavie (marbre blanc), d’Afghanistan/Pakistan (onyx vert avec translucidités), d’Egypte (rouge orangé)…\",\"materiaux\":\"granit, marbre\",\"couleur\":\"gris\",\"mouvement_artistes\":\"art conceptuel\",\"contexte_production\":\"Saint-Martin-Cantalès est une petite commune de l'ouest du département du Cantal. Le 1er mars 2008, son monument aux morts érigé en 1926 sur la place de l'église s'est effondré sous le poids de la neige. L'architecte des bâtiments de France sollicité le déclare non restaurable, mais la collectivité n'envisage pas son non remplacement. Le monument fait partie du territoire du quotidien d'un village au même titre que mairie ou l'église. Il participe de l'imaginaire collectif et de la construction de la conscience d'appartenance territoriale. L'architecte suggère alors la création d'une oeuvre contemporaine. Le projet retenu en 2011 est celui de Guillaume Leblon.\",\"programme\":\"Commande publique\",\"nature\":\"pérenne\",\"description\":\"«Cette proposition d’œuvre est constituée de grandes plaques et blocs de pierres (marbres, granit....) superposés, empilés, comme stratifiés. Entre chaque bloc, un espace, un jour qui allègent et décollent le monument. Chaque bloc provient d’une géographie multiple, correspondant à un site historique de batailles, de conflits et de guerres qui résonnent dans l’inconscient collectif. La surface terrestre est symboliquement toute entière contenue dans cette compilation massive de « pierres du monde». Les blocs sont laissés bruts d’extraction au sortir de la carrière. Ils sont là, telles des pierres mégalithiques et, tout de suite, la solennité de ces pierres s’impose. Les tranches de ces blocs de pierre sont gravées des noms des soldats morts au cours des deux guerres mondiales. On se retrouve face à une impression millénaire, quasi hiéroglyphique, ramenée ici à la mémoire des deux grands conflits du XXe siècle. (Extrait de la note d'intention rédigée par Guillaume Leblon,\",\"latitude\":\"45.092812279001\",\"longitude\":\"2.2998775541782\",\"inauguration\":\"2014\",\"titre\":\"Géologie de la Mémoire\",\"image_principale\":\"leblon-geologie.jpg\",\"creditphoto\":\"Voir atlasmusuem.net\",\"artiste\":\"Guillaume Leblon\",\"url\":\"http://atlasmuseum.irisa.fr/www/index.php/G&#233;ologie_de_la_M&#233;moire_(Guillaume_Leblon)\"}");
