		obj = new JSONObject("{\"id\":\"2088\",\"Sitepmr\":\"site accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Pays de la Loire\",\"Siteville\":\"Indre\",\"Sitedetails\":\"Site de l'entreprise DCNS\",\"Sitenom\":\"DCNS\",\"mot_cle\":\"serpent, ligne serpentine, dragon, fleuve, industrie, tuyau\",\"precision_materiaux\":\"PVC\",\"materiaux\":\"plastique\",\"couleur\":\"rouge\",\"contexte_production\":\"Manifestation Estuaire 2009\",\"nature\":\"pérenne\",\"description\":\"L’étrange animal “industriel” qui surgit sur le ponton est constitué de tubulures qui évoquent un serpent de mer ou un dragon de plus de 40 m de long. Il sort du fleuve, rampe et se dresse face à la Loire, “gueule ouverte” tel le Léviathan. La figure du serpent et l’utilisation de tubes industriels sont récurrentes dans l’œuvre de Jimmie Durham. Le serpent symbolise notamment le fleuve et le tube représente un “conduit” pour l’imagination permettant de décloisonner – tout en les reliant – espaces et hiérarchies : eau/ciel, dessus/dessous, visible/invisible, passé/avenir…\",\"latitude\":\"47.19653108157004\",\"longitude\":\"-1.6777592897415161\",\"inauguration\":\"2009\",\"titre\":\"Serpentine rouge\",\"image_principale\":\"Serpentinerouge.jpg\",\"creditphoto\":\"Jimmie Durham, photo © Stephan Menoret, Ville de Nantes\",\"artiste\":\"Jimmie Durham\",\"url\":\"http://atlasmuseum.irisa.fr/www/index.php/Serpentine_rouge_(Jimmie_Durham)\"}");
