		obj = new JSONObject("{\"id\":\"2078\",\"materiaux\":\"résine\",\"couleur\":\"bleu, jaune, orange, rouge, vert, violet\",\"mouvement_artistes\":\"art environnemental, art in situ, art urbain\",\"nature\":\"pérenne\",\"description\":\"L’arc en ciel de Philippe Berry a posé ses 6 mètres de haut (et 10 de longueur) au mois de décembre, première œuvre monumentale installée sur le parc paysager des Docks de Saint-Ouen, lieu dédié aux habitants en général et aux enfants en particulier. Grâce à cette sculpture, les parents aussi retrouvent à chaque balade un cœur tendre et une envie d’universel, du moins est-ce le souhait de l’artiste qui par son travail rêve d’« inscrire l’histoire de l’enfance dans l’histoire de l’art » en capturant, comme ici, ces « moments éphémères et impalpables qui sont pourtant connus de nous tous qui avons été des enfants ». Cette œuvre-là contient un autre hommage, non pas aux partisans du mariage pour tous mais plus largement à Nelson Mandela et à sa “nation arc-en-ciel” post-apartheid.\",\"latitude\":\"48.9163088\",\"longitude\":\"2.3249135\",\"inauguration\":\"2013\",\"titre\":\"Arc-en-ciel de Philippe Berry\",\"image_principale\":\"Image principale de Arc-en-ciel.jpeg\",\"creditphoto\":\"Voir atlasmusuem.net\",\"artiste\":\"Philippe BERRY\",\"Sitepays\":\"Pays\",\"Siteville\":\"Ville\",\"url\":\"http://atlasmuseum.irisa.fr/www/index.php/Arc-en-ciel_de_Philippe_Berry_(Philippe_BERRY)\"}");
