		obj = new JSONObject("{\"id\":\"2033\",\"Sitepmr\":\"site accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Nord-Pas de Calais\",\"Siteville\":\"Lille\",\"Sitenom\":\"EURALILLE\",\"couleur\":\"blanc, rose, vert\",\"contexte_production\":\"La Maison de l’architecture et de la ville (MAV) et la SPL Euralille ont passé commande d’une micro-architecture permettant d’animer la place François Mitterrand, située entre les deux gares et le centre-ville de Lille.\",\"description\":\"L’artiste Erwin Wurm, réalise Bob, une œuvre pérenne à la forme étonnante et drôle qui détourne un marqueur fort de l’identité du Nord, la baraque à frite. Libéré de sa forme originelle, le volume de la baraque donne l’impression d’une masse molle et fondante. Par ce geste, Erwin Wurm permet à la baraque de devenir œuvre sculpturale. Ici la forme se joue de la fonction, elle interroge et surprend. Cette masse fondante peut pourtant évoquer la tentation et le plaisir gourmand.\",\"latitude\":\"50.639631432891\",\"longitude\":\"3.0753403902054\",\"inauguration\":\"2013\",\"titre\":\"Bob\",\"image_principale\":\"Image-sous-droit.jpg\",\"creditphoto\":\"== Conditions d'utilisation == {{cc-zero }}\",\"artiste\":\"Erwin Wurm\",\"url\":\"http://atlasmuseum.irisa.fr/www/index.php/Bob_(Erwin_Wurm)\"}");
