		obj = new JSONObject("{\"id\":\"1577\",\"latitude\":\"49.7556\",\"longitude\":\"0.3807\",\"Sitepays\":\"France\",\"Siteregion\":\"Haute-Normandie\",\"Siteville\":\"Fécamp\",\"Sitedetails\":\"espace de deuil\",\"Sitenom\":\"Centre hospitalier intercommunal du Pays des Hautes Falaises\",\"image_principale\":\"3P05534.jpg\",\"creditphoto\":\"Bruno Carbonnet (© Adagp, Paris)\",\"precision_materiaux\":\"peinture sur bois, vernis épais, dispositif lumineux\",\"materiaux\":\"peinture, bois, vernis, lumière\",\"nature\":\"pérenne\",\"contexte_production\":\"Réalisé dans le cadre de la création d'un espace lié au deuil avec un oratoire multiconfessionnel, deux salles d'exposition des corps, une salle de mise en bière, une morgue, ces espaces étant desservis par un vaste couloir comprenant une salle d'attente.\",\"inauguration\":\"2006\",\"proprietaire\":\"Centre hospitalier intercommunal du Pays de Hautes Falaises, Fécamp\",\"programme\":\"Commande publique\",\"description\":\"Dans l'Espace de deuil : 'panneaux de peinture', verticaux, hauts et étroits, tous du même format, comme en lévitation sur le mur. Ils sont peints sur bois et vernis pour créer des reflets de lumière. Ni abstraits, ni figuratifs, certains sont des vibrations colorées et font penser aux paysages de Normandie, d'autres vont vers le monochrome pur. Salle de recueillement : 3 panneaux colorés, mats, en décalé du mur dans lequel s'inscrit un dispositif lumineux. Des taches de macules de peinture ont été prises en photo, agrandies puis inversées par procédé photographique, qui laissent transparaître la lumière. Demi-bancs hauts qui permettent d'avoir, assis, la main juste à la hauteur du corps. Table-pupitre haute. Salle d'attente : panneau noir et panneau bleu. Sol uniforme, sombre et brillant reflétant la lumière.\",\"titre\":\"Soin du deuil\",\"artiste\":\"Bruno Carbonnet\",\"url\":\"http://atlasmuseum.irisa.fr/www/index.php/Soin_du_deuil_(Bruno_Carbonnet)\"}");
