		obj = new JSONObject("{\"id\":\"1484\",\"Sitepays\":\"France\",\"Siteregion\":\"Bretagne\",\"Siteville\":\"Rennes\",\"Sitenom\":\"Parc de Beauregard\",\"proprietaire\":\"Ville de Rennes\",\"precision_materiaux\":\"granit de louvigné du désert\",\"materiaux\":\"granit\",\"contexte_production\":\"Il s'agit de l'unique sculpture monumentale réalisée par Aurélie Nemours (1910 - 2005)\",\"programme\":\"Commande publique\",\"nature\":\"pérenne\",\"description\":\"Dans la tradition des alignements mégalithiques de Carnac ou de Stonehenge, 72 piliers (9X8) alignés selon un plan orthogonal rectangulaire offrent de multiples variations géométriques. Dans le sens de la largueur, les 8 piliers sont espacés de 270 cm. Dans le sens de la longeur, les 9 piliers, espacés de 180 cm, suivent le même axe que celui que l'on considère comme l'axe fondateur de la ville de Rennes. Tous les jours à midi (heure solaire), l'ombre portée des colonnes est parfaitement alignée en direction du nord. Les principes mis en oeuvre dans 'Le Rythme du millimètre', série de peintures de 1975 à 1990 sont développés ici en trois dimensions.\",\"latitude\":\"48.1304\",\"longitude\":\"-1.6962\",\"inauguration\":\"2005\",\"titre\":\"Alignement du XXIème siècle\",\"image_principale\":\"3P05545.jpg\",\"creditphoto\":\"Aurelie Nemours (© Adagp, Paris) / photographe : Rennes Métropole Communauté d'agglomération\",\"artiste\":\"Aurelie Nemours\",\"url\":\"http://atlasmuseum.irisa.fr/www/index.php/Alignement_du_XXI&#232;me_si&#232;cle_(Aurelie_Nemours)\"}");
