		obj = new JSONObject("{\"id\":\"1450\",\"Sitepays\":\"France\",\"Siteregion\":\"Ile-de-France\",\"Siteville\":\"Cergy-Pontoise\",\"Sitedetails\":\"Axe majeur de Cergy-Pontoise\",\"proprietaire\":\"Ville de Cergy\",\"programme\":\"Commande publique\",\"nature\":\"pérenne\",\"description\":\"Axe ésotérique qui traverse la France, débute à la tour belvédère de Cergy-Saint Christophe et croise le méridien de Paris à hauteur de la pyramide du Louvre. Le site est divisé en douze stations: place des colonnes Hubert-Renaud (et la tour belvédère), le parc des impressionnistes, l'esplanade de Paris, la terrasse, les jardins des droits de l'homme Pierre Mendes France, l'amphithéâtre, la scène, la passerelle, l'île astronomique, la pyramide, le carrefour du ham. Les douze stations symbolisent le temps : douze heures, douze mois, le jour, la nuit. L'Axe Majeur se déploie sur 3 km depuis Cergy-Pontoise jusqu'à l'Oise. La tour belvédère, le point de départ du tracé, est légèrement inclinée en direction de l'Axe Majeur. Son sommet offre une vue panoramique sur l'Ile-de-France et, la nuit, un laser balaye l'axe.\",\"latitude\":\"49.045997\",\"longitude\":\"2.03347\",\"inauguration\":\"1992\",\"titre\":\"L'Axe Majeur - La tour belvédère\",\"image_principale\":\"3P05195.jpg\",\"creditphoto\":\"Dani Karavan (© Dani Karavan)\",\"artiste\":\"Dani Karavan\",\"url\":\"http://atlasmuseum.irisa.fr/www/index.php/L'Axe_Majeur_-_La_tour_belv&#233;d&#232;re_(Dani_Karavan)\"}");
